import classes from "./Nav.module.css";

const Nav = () => {
  return (
    <div className={classes.nav_bar}>
      <ul className={classes.links}>
        <li className="logo">Sneakers</li> <li className="link">Collections</li>
        <li className="link">Men</li> <li>Women</li>
        <li className="link">About</li> <li className="link">Contact</li>
      </ul>
    </div>
  );
};

export default Nav;
